import React from "react";
import { Col, Container, Row } from "react-bootstrap";
import Card from "react-bootstrap/Card";
import ListGroup from "react-bootstrap/ListGroup";
import data from "../components/packet.json";
import {} from "../img/About.css";
const About = () => {
  return (
    <>
      <Container className="methodcards">
        <Row>
          {data.map((item) => (
            <Card key={item.id} className="sizeCard">
              <Card.Img variant="top" src={item.image} alt="images" />
              <Card.Body>
                <Card.Title>{item.name}</Card.Title>
                <Card.Text></Card.Text>
              </Card.Body>
              <ListGroup className="list-group-flush">
                <ListGroup.Item>
                  {" "}
                  Energy{item.energy_value} {item.energy_unit}
                </ListGroup.Item>
                <ListGroup.Item>
                  Protein{item.proteins_value} {item.proteins_unit}
                </ListGroup.Item>
                <ListGroup.Item>
                
                </ListGroup.Item>
                <ListGroup.Item>
                
                </ListGroup.Item>
              </ListGroup>
              <Card.Body>
                <Card.Link href="#">Card Link</Card.Link>
                <Card.Link href="#">Another Link</Card.Link>
              </Card.Body>
            </Card>
          ))}
        </Row>
      </Container>
    </>
  );
};

export default About;
